import {getPlayerOfRoomApi} from "./api/RoomApiService";

export default function ListPlayers(){

    function catchPlayersOfRoom(roomCode){
        getPlayerOfRoomApi(roomCode);
    }

    return (
      <div className="container">
          <h3>List of Player</h3>
          <table>
              <thead>
                <tr>
                    <th></th>
                </tr>
              </thead>
              <tbody>
                <tr>
                    <td>Alox</td>
                </tr>
              </tbody>
          </table>
      </div>
    );
}
